import React from 'react'
import { Row } from 'react-bootstrap'
import CardMovies from './CardMovies'

const MovieList = ({movies}) => {
  return (
    <Row>
      {
        movies.length >= 1 ? (movies.map((mov)=>{
          return(<CardMovies key={mov.id} mov={mov}/>);
        })) : <h2>No Movies</h2>
      }
    </Row>
  )
}

export default MovieList
